// @ts-check
import antfu from '@antfu/eslint-config';
import nextPlugin from '@next/eslint-plugin-next';
import jsxA11yPlugin from 'eslint-plugin-jsx-a11y';
import reactPlugin from 'eslint-plugin-react';
import hooksPlugin from 'eslint-plugin-react-hooks';

export default antfu({
  typescript: true,
  formatters: true,
  stylistic: {
    semi: true,
    overrides: {
      'style/arrow-parens': 'error',
      'style/brace-style': ['error', '1tbs', { allowSingleLine: true }],
    },
  },
  javascript: {
    overrides: {
      'antfu/no-top-level-await': 'off',
    },
  },
  ignores: [
    'css/*.css',
    'iconoir.com/out/',
    '**/.expo/',
    'packages/iconoir-flutter/.dart_tool/',
    'packages/iconoir-flutter/build/',
    'packages/iconoir-flutter/example/',

  ],
  rules: {
    'style/padding-line-between-statements': [
      'error',
      {
        blankLine: 'always',
        prev: [
          'block',
          'block-like',
          'cjs-export',
          'class',
          'multiline-block-like',
          'multiline-const',
          'multiline-expression',
          'multiline-let',
          'multiline-var',
        ],
        next: '*',
      },
      {
        blankLine: 'always',
        prev: ['const', 'let'],
        next: [
          'block',
          'block-like',
          'cjs-export',
          'class',
        ],
      },
      {
        blankLine: 'always',
        prev: '*',
        next: [
          'multiline-block-like',
          'multiline-const',
          'multiline-expression',
          'multiline-let',
          'multiline-var',
        ],
      },
    ],
  },
}, {
  files: ['iconoir.com/**'],
  plugins: {
    '@next/next': nextPlugin,
    'react': reactPlugin,
    'react-hooks': hooksPlugin,
    'jsx-a11y': jsxA11yPlugin,
  },
  settings: {
    next: {
      rootDir: 'iconoir.com/',
    },
    react: {
      version: 'detect',
    },

  },
  // @ts-ignore
  rules: {
    ...nextPlugin.configs.recommended.rules,
    ...nextPlugin.configs['core-web-vitals'].rules,
    ...reactPlugin.configs.recommended.rules,
    ...hooksPlugin.configs.recommended.rules,

    // rules from "eslint-config-next"
    'import/no-anonymous-default-export': 'warn',
    'react/no-unknown-property': 'off',
    'react/react-in-jsx-scope': 'off',
    'react/prop-types': 'off',
    'jsx-a11y/alt-text': [
      'warn',
      {
        elements: ['img'],
        img: ['Image'],
      },
    ],
    'jsx-a11y/aria-props': 'warn',
    'jsx-a11y/aria-proptypes': 'warn',
    'jsx-a11y/aria-unsupported-elements': 'warn',
    'jsx-a11y/role-has-required-aria-props': 'warn',
    'jsx-a11y/role-supports-aria-props': 'warn',
    'react/jsx-no-target-blank': 'off',
  },
});

{
  "name": "iconoir",
  "type": "module",
  "version": "7.10.1",
  "packageManager": "pnpm@9.15.1",
  "description": "Iconoir - The biggest open source icon library with tons of free icons.",
  "license": "MIT",
  "funding": {
    "type": "opencollective",
    "url": "https://opencollective.com/iconoir"
  },
  "homepage": "https://iconoir.com",
  "repository": {
    "type": "git",
    "url": "https://github.com/iconoir-icons/iconoir.git"
  },
  "keywords": [
    "free",
    "icons",
    "library",
    "svg",
    "css"
  ],
  "exports": {
    "./icons/*.svg": "./icons/regular/*.svg",
    "./icons/*-solid.svg": "./icons/solid/*.svg",
    "./icons/regular/*.svg": "./icons/regular/*.svg",
    "./icons/solid/*.svg": "./icons/solid/*.svg",
    "./css/*.css": "./css/*.css"
  },
  "files": [
    "css/*.css",
    "icons"
  ],
  "scripts": {
    "build": "node ./bin/build/index.js",
    "lint": "eslint .",
    "lint:fix": "pnpm run lint --fix",
    "prepublish-all": "node ./bin/prepublish.js"
  },
  "devDependencies": {
    "@antfu/eslint-config": "^3.12.0",
    "@atomist/yaml-updater": "^1.0.2",
    "@svgr/babel-plugin-remove-jsx-attribute": "^8.0.0",
    "@svgr/core": "^8.1.0",
    "@svgr/plugin-jsx": "^8.1.0",
    "@vitejs/plugin-vue": "^5.2.1",
    "esbuild": "^0.24.0",
    "eslint": "^9.17.0",
    "eslint-plugin-format": "^0.1.3",
    "hast-util-from-html": "^2.0.3",
    "hast-util-to-html": "^9.0.4",
    "listr2": "^8.2.5",
    "prettier": "^3.4.2",
    "scule": "^1.3.0",
    "semver": "^7.6.3",
    "tinypool": "1.0.2",
    "typescript": "~5.7.2",
    "vite": "^6.0.4",
    "vite-plugin-dts": "^4.4.0"
  },
  "pnpm": {
    "packageExtensions": {
      "react-native-svg": {
        "peerDependencies": {
          "@types/react": "18"
        }
      },
      "@types/react-window": {
        "dependencies": {
          "@types/react": "19"
        }
      }
    }
  }
}
